import { Fragment } from 'react/cjs/react.production.min';
import classes from './Settings.module.css';
import Backdrop from '../Backdrop/Backdrop';

const Settings = () => {
    return (
        <Fragment>
            <Backdrop />
            <div className={classes.goback}>
                LOG OUT
            </div>
        </Fragment>
    );
};

export default Settings;
